import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import Stack from '@mui/material/Stack';
import Card from '../components/card';
import FormGroup from '../components/form-group';
import { mensagemSucesso, mensagemErro } from '../components/toastr';
import '../custom.css';
import axios from 'axios';
import { BASE_URL } from '../config/axios';

function CadastroCargos() {
    const { idParam } = useParams();
    const navigate = useNavigate();
    const baseURL = `${BASE_URL}jsonfake4/cargos`;

    const [id, setId] = useState('');
    const [nome, setNome] = useState('');
    const [permissoes, setPermissoes] = useState([]);

    const [dados, setDados] = useState([]);
    const [listaPermissoes, setListaPermissoes] = useState([]);

    // Inicializa os estados com base no idParam
    function inicializar() {
        if (idParam == null) {
            setId('');
            setNome('');
            setPermissoes([]); // Inicializa como array vazio
        } else {
            setId(dados.id);
            setNome(dados.nome);
            setPermissoes(dados.permissoes || []); // Garante que seja um array
        }
    }

    // Salva o cargo no backend
    async function salvar() {
        let data = { id, nome, permissoes };
        data = JSON.stringify(data);
        if (idParam == null) {
            await axios
                .post(baseURL, data, {
                    headers: { 'Content-Type': 'application/json' },
                })
                .then(function (response) {
                    mensagemSucesso(`Cargo ${nome} cadastrado com sucesso!`);
                    navigate(`/listagem-cargos`);
                })
                .catch(function (error) {
                    mensagemErro(error.response.data);
                });
        } else {
            await axios
                .put(`${baseURL}/${idParam}`, data, {
                    headers: { 'Content-Type': 'application/json' },
                })
                .then(function (response) {
                    mensagemSucesso(`Cargo ${nome} alterado com sucesso!`);
                    navigate(`/listagem-cargos`);
                })
                .catch(function (error) {
                    mensagemErro(error.response.data);
                });
        }
    }

    // Busca os dados do cargo e a lista de permissões
    async function buscar() {
        if (idParam != null) {
            await axios.get(`${baseURL}/${idParam}`)
                .then((response) => {
                    setDados(response.data);
                    setId(response.data.id);
                    setNome(response.data.nome);
                    setPermissoes(response.data.permissoes || []); // Garante que seja um array
                })
                .catch((error) => {
                    console.log(error);
                });
        }
        await axios.get(`${BASE_URL}/jsonfake3/permissoes`)
            .then((response) => {
                setListaPermissoes(response.data);
            })
            .catch((error) => {
                console.log(error);
            });
    }

    // Atualiza o estado das permissões selecionadas
    const handlePermissoesChange = (event) => {
        const selectedOptions = Array.from(event.target.selectedOptions, (option) => option.value);
        const permissoesSelecionadas = selectedOptions.map((id) =>
            listaPermissoes.find((perm) => perm.id === parseInt(id))
        );
        setPermissoes(permissoesSelecionadas);
    };

    // Busca os dados ao carregar o componente
    useEffect(() => {
        buscar();
    }, [idParam]);

    if (!dados && idParam) return null; // Aguarda o carregamento dos dados

    return (
        <div className='container'>
            <Card title='Cadastro de Cargo'>
                <div className='row'>
                    <div className='col-lg-12'>
                        <div className='bs-component'>
                            <FormGroup label='Nome: *' htmlFor='inputNome'>
                                <input
                                    type='text'
                                    id='inputNome'
                                    value={nome}
                                    className='form-control'
                                    name='nome'
                                    onChange={(e) => setNome(e.target.value)}
                                />
                            </FormGroup>
                            <FormGroup label='Permissões: ' htmlFor='inputPermissoes'>
                                <select
                                    multiple
                                    id='inputPermissoes'
                                    value={permissoes.map((perm) => perm.id)} // Array de IDs
                                    className='form-control'
                                    name='permissoes'
                                    onChange={handlePermissoesChange}
                                >
                                    {listaPermissoes.map((perm) => (
                                        <option value={perm.id} key={perm.id}>{perm.nome}</option>
                                    ))}
                                </select>
                            </FormGroup>

                            <Stack spacing={1} padding={1} direction='row'>
                                <button
                                    onClick={salvar}
                                    type='button'
                                    className='btn btn-success'
                                >
                                    Salvar
                                </button>
                                <button
                                    onClick={inicializar}
                                    type='button'
                                    className='btn btn-danger'
                                >
                                    Cancelar
                                </button>
                            </Stack>
                        </div>
                    </div>
                </div>
            </Card>
        </div>
    );
}

export default CadastroCargos;
